import React from "react";
import {
  Navbar,
  Nav,
} from "react-bootstrap";
import { Link } from 'react-router-dom';
import "bootstrap/dist/css/bootstrap.min.css";

class NavBar extends React.Component {


  render() {
    return (
      <Navbar fixed="top" className="portfolioNavbar" expand="md">
        <Navbar.Brand as={Link} className="navbarText" to="/">
          Stephen Doyle
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav>

            <Nav.Link className="navbarText" as={Link} to="/about">About
            </Nav.Link>
            <Nav.Link as={Link} className="navbarText" to="/projects">
              Projects
            </Nav.Link>
            <Nav.Link as={Link} className="navbarText" to="/articles">
              Articles
            </Nav.Link>
            <Nav.Link as={Link} className="navbarText" to="/resources">
              Resources
            </Nav.Link>
            <Nav.Link as={Link} className="navbarText" to="/contact">
              Contact
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

export default NavBar;
